export class ACLUtils{static notDef(t){return null==t}static isDef(t){return!ACLUtils.notDef(t)}static hasText(t){return ACLUtils.isDef(t)&&"string"==typeof t&&t.length>0&&t.trim().length>0}static isNumber(t){return!isNaN(parseFloat(t))&&!isNaN(t-0)}static _hasProperty(t,e){return ACLUtils.hasText(t[e])}static fixId(t){return!t||t.length<=0?"":"#"===t[0]?t:"#"+t}static parseThemeString(t){return this.hasText(t)?JSON.parse(t):{}}static parseBufferSizes(t){if(null==typeof t)return[1];let e=[];try{if(!this.hasText(t))return[1];{let r=t.split(",");for(let t=0;t<r.length;t++){if(t>=3)continue;let s=parseFloat(r[t]);e.push(s)}}}catch(t){return console.log(t),[1]}return e}}